import Link from "next/link";

export default function User({ user }) {
  return (
    <div>
      <p>
        <Link href={`/user/${user.id}`}>{user.name}</Link>
      </p>

      <table>
        <tr>
          <th>Name</th>
          <th>Email</th>
          <th>Id</th>
          <th>Phone Number</th>
        </tr>
        <tr>
          <td>{user.name}</td>
          <td>{user.email}</td>
          <td>{user.id}</td>
          <td>{user.phoneNumber}</td>
        </tr>
      </table>

      {/* <p>{user.id}</p>
      <p>{user.email}</p>
      <p>{user.phoneNumber}</p> */}
      <div className="buttonList">
        <Link
          href={{
            pathname: "/update",
            query: {
              id: user.id,
            },
          }}
        >
          Edit ✏️
        </Link>
        {/* <DeleteProduct id={user.id}>Delete</DeleteProduct> */}
      </div>
    </div>
  );
}
